// src/pages/Home.js
import React from "react";
import { Link } from "react-router-dom";

function Home() {
  return (
    <div style={{ textAlign: "center", marginTop: "50px" }}>
      <h1>Welcome to the Resume Builder</h1>
      <Link to="/resume">
        <button style={{ marginTop: "20px", padding: "10px 20px" }}>
          Create Resume
        </button>
      </Link>
    </div>
  );
}

export default Home;
